export const onChangeGigDate = (editGig, event) => {
    editGig.setState({
        gig_date: event
    }, () => {
        if (editGig.state.festival_end_date < editGig.state.gig_date) {
            editGig.setState({
                festival_end_date: editGig.state.gig_date
            });
        }
    });
}
